import React from 'react';
import styled from 'styled-components';

export default function Header({ name, dob, stats}) {
    return (
        <HeaderContainer>
            <Image />
            <Title>{name}</Title>
        </HeaderContainer>
    )
}

const HeaderContainer = styled.div`
    height: 50%;
    width: 100%;
`

const Image = styled.img`
    width: 100%;
    height: 100%;
    object-fit: cover;
`
const Title = styled.h1`
    text-align: center;
    width: 60%;
    margin: auto;
    position: absolute;
    bottom: 0;
`
